import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <h2>Agendamento Médico</h2>
      <nav>
        <Link to="/">Home</Link> | <Link to="/servicos/Pediatria">Serviços</Link>
      </nav>
    </header>
  );
}

export default Header;
